DROP TABLE IF EXISTS `tb_oldhouse0`;
CREATE TABLE `tb_oldhouse0` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `BuildingNo` varchar(20) DEFAULT NULL,
  `personId` int(11) DEFAULT NULL,
  `OriginalTenant` varchar(255) DEFAULT NULL,
  `em_state` tinyint(4) DEFAULT NULL COMMENT '原承租人当前状态(1在岗,2退休,3已去世,4内退,5离职,6离休,7长病,8长期矿工,9停薪留职)',
  `otUid` varchar(10) DEFAULT NULL COMMENT '原承租人职工号',
  `PresentTenant` varchar(255) DEFAULT NULL,
  `IDCardNo` varchar(255) DEFAULT NULL,
  `Tel` varchar(255) DEFAULT NULL,
  `S` varchar(255) DEFAULT NULL,
  `S1` varchar(255) DEFAULT NULL COMMENT '改善面积S1=10%*S',
  `S2` varchar(255) DEFAULT NULL COMMENT '补偿面积 S2=50-S>0?(50-S):0',
  `S3` varchar(255) DEFAULT NULL COMMENT '调房核算面积 S3=S+10%*S = S+S1',
  `M1` varchar(255) DEFAULT NULL COMMENT '补偿金额M1=S2*5000*(1+0.2)*40%',
  `R0` varchar(255) DEFAULT NULL COMMENT '搬家奖励R0=S*300<20000?20000:S*300',
  `R` varchar(255) DEFAULT NULL COMMENT '搬家奖励R=R0+1000',
  `T0` varchar(255) DEFAULT NULL COMMENT '临时安置费(每月)T0=S*18<=800?800:(S*18>=1200?1200:S*18)',
  `teamId` varchar(255) DEFAULT NULL,
  `state` tinyint(4) DEFAULT NULL,
  `NQP` varchar(255) DEFAULT NULL,
  `SeqId` varchar(255) DEFAULT NULL COMMENT '顺序号',
  `OldSeqId` varchar(255) DEFAULT NULL,
  `areaId` tinyint(4) DEFAULT NULL,
  `CheckHouseInfo` varchar(255) DEFAULT NULL,
  `modify_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `WaterMeterReading` varchar(255) DEFAULT NULL,
  `ElecMeterReading` varchar(255) DEFAULT NULL,
  `AccountBalance` varchar(255) DEFAULT NULL,
  `remark` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `IdentityCardNo` (`IDCardNo`) USING BTREE,
  KEY `teamId` (`teamId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=383 DEFAULT CHARSET=utf8;

